import React from 'react';


const NotFound = () => {
    return (
        <React.Fragment>

            <h1 className="x-large text-primary">
              <i className="fas fa-exclamation-triangle" /> Page Not Found
            </h1>

            <p className="large">Sorry, this page could not be found</p>
            
        </React.Fragment>
    )
}



export default NotFound;
